  return (
    <div className="expense-item">
      <ExpenseDate date={props.date}></ExpenseDate>
      <Expenses
        title={expenses[0].title}
        amount={expenses[0].amount}
        date={expenses[0].date}
      ></Expenses>
    </div>
  );
}

